from math import factorial
from fractions import Fraction
def a(n):
  s = sum(Fraction(2**k-4, 2**k*factorial(k)) for k in range(2, n+1))
  return s.denominator
print([a(n) for n in range(1, 21)]) # _Michael S. Branicky_, Feb 07 2021

